Thankful for everyone who came together and helped make the Opportunity Awaits ride day possible this past weekend. This Saturday, September 25 we're getting back to the track for the @bp73motoranch ride day to support the @ryandungeyfoundation , benefitting @stjude and @allkidsbike . You can register on BPMotoRanch.com and I hope to see everyone there! 

@ktmusa @foxmoto @kutzlerexpressinc @north.american.trailer @striderbikes @ridestacyc @nlsportsinc @foxraceway @moto4kids.racing 

Photos: @cycledump

Save the date and join me @foxraceway for the @ryandungeyfoundation Opportunity Awaits ride day on September 18. 

You can learn more about the event, including registration details, on the link in my bio. I appreciate everyone's support and hope to see you there! 

@ktmusa @foxmoto @striderbikes @ridestacyc @kutzlerexpressinc @north.american.trailer @nlsportsinc
